    const [formulario, setFormulario] = useState([])
    const navigate = useNavigate()
    const inscrever = (lugar) => {navigate(lugar)}


    setFormulario({[EventoID]: IDEvento, [UsuarioID]: IDUsuario, [Status]: ""})




    return (
        <button className={`
            ${styles.botaoPrincipal}
            ${styles[tamanho]}`}
            onClick={() => inscrever(`${destino}${IDDestino}`)}
            >
            {children}
        </button>
    )
}

